package com.algorithm.contest.weeklycontest214;

import java.util.PriorityQueue;

public class MinDeletions {
    public static void main(String[] args) {
        MinDeletions m = new MinDeletions();
//        System.out.println(m.minDeletions("aab"));
//        System.out.println(m.minDeletions("aaabbbcc"));
        System.out.println(m.minDeletions(""));
    }
    public int minDeletions(String s) {
        char[] chrs = s.toCharArray();
        int[] chs = new int[26];
        for (char c : chrs) {
            chs[c - 'a']++;
        }
        PriorityQueue<Integer> q = new PriorityQueue<>((a, b) -> b - a);
        for (int c : chs) {
            if (c != 0) {
                q.offer(c);
            }
        }
        int cnt = 0;
        while (!q.isEmpty()) {
            Integer top = q.poll();
            if (!q.isEmpty() && top.intValue() == q.peek().intValue()) {
                top--;
                cnt++;
                if (top != 0) {
                    q.offer(top);
                }
            }
        }
        return cnt;
    }
}
